import React from "react";

class LinksResult extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    console.log(this.props.mod);

    let modView;
    if (this.props.mod) {
      modView = <small></small>;
    }

    return (
      <li className="linksListItem">
        <a id={this.props.id} href={this.props.url}>
          <b>{this.props.text}</b>
        </a>
        {modView}
      </li>
    );
  }
}

export default LinksResult;
